export default function DigitButton({ dispatchEvent, digit }) {
	return (
		<button
			onClick={() => dispatch({ type: ACTIONS.ADD_DIGIT, payload: { digit } })}
		>
			{" "}
			{digit}{" "}
		</button>
	);
}
